import React from 'react';
import logo from './logo.svg';
import './App.css';
import Form from "./Components/Form";
import FilterableProductTable from "./Components/FilterableProduct/FilterableProductTable";

function App() {
  return (
    <div className="App">
      <Form />
      <FilterableProductTable />
    </div>
  );
}

export default App;
